package uz.pdp.uiexam

import android.os.Bundle
import androidx.fragment.app.Fragment
import android.view.LayoutInflater
import android.view.View
import android.view.ViewGroup
import androidx.recyclerview.widget.LinearLayoutManager
import androidx.recyclerview.widget.RecyclerView

class SearchFragment : Fragment() {

    private lateinit var rvSearch: RecyclerView
    private lateinit var searchAdapter: SearchAdapter

    override fun onCreateView(
        inflater: LayoutInflater, container: ViewGroup?,
        savedInstanceState: Bundle?
    ): View? {
        // Inflate the layout for this fragment
        return inflater.inflate(R.layout.fragment_search, container, false)
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)

        rvSearch = view.findViewById(R.id.rvSearch)
        rvSearch.layoutManager = LinearLayoutManager(requireActivity())

        refreshSearch(getAllResults())
    }

    private fun refreshSearch(allResults: java.util.ArrayList<Search>) {
        searchAdapter = SearchAdapter(requireActivity(), allResults)
        rvSearch.adapter = searchAdapter
    }

    private fun getAllResults(): ArrayList<Search> {
        return ArrayList<Search>().apply {
            for (i in 0..3) {
                this.add(
                    Search(
                        "data:image/jpeg;base64,",
                        "Valley Tovem",
                        "1300 Union St"
                    )
                )
                this.add(
                    Search(
                        "data:image/jpeg;base64,",
                        "Gamine",
                        "1231 Fillimore St"
                    )
                )
                this.add(
                    Search(
                        "data:image/jpeg;base64,",
                        "Saint Frank Coffee",
                        "200 Market Street"
                    )
                )
                this.add(
                    Search(
                        "data:image/jpeg;base64,",
                        "Doppio Zero",
                        "404 Fulton St"
                    )
                )
            }
        }
    }
}